// src/pages/Main.js
import React from 'react';

const Main = () => {
  return (
    <div style={{ padding: '40px', textAlign: 'center' }}>
      <h1>메인 페이지</h1>
      <p>여기는 메인 페이지 내용입니다.</p>
    </div>
  );
};

export default Main;
